import React from 'react';
import { Link } from 'react-router-dom';
const Guideme = () => {
    return(
        <>
            <div id="screen1" className="screen1 guideBox">
                 <div className="msgBox"> 
                    <h1>Check Out Leadership Board Folks</h1>
                    <Link  onClick={Scren2} to="/"  className="btn btn-info">Got It!</Link>
               </div>
            </div>
            <div id="screen2" className="screen2 guideBox">
                 <div className="msgBox"> 
                    <h1>Check Out Leadership Board Folks</h1>
                    <Link  to="/"  className="btn btn-info">Got It!</Link>
               </div>
            </div>
        </>
    );
}
const Scren2 = () => { 
    var element = document.getElementById("screen1");
    element.classList.remove("ShowGuide");    
    var elements = document.getElementById("Leadership");
    elements.classList.remove('Zindex');     
}
export default Guideme;
